
<!DOCTYPE html>
<html lang="en">
	<head>
		<meta charset="utf-8">
		<title>
			ArchaeoGlobe Interactive Map
		</title>
		<script src="http://d3js.org/d3.v3.min.js" charset="utf-8"></script>
		<script src="d3.v3.min.js"></script>
		<script src="http://d3js.org/colorbrewer.v1.min.js"></script>
		<script src="colorbrewer.v1.min.js"></script>

		<style type="text/css">


		</style>
	</head>
	<body>
		<h2 style = "text-align:center; color:black"><bold>ArchaeoGlobe Interactive Map</bold></h2>

		<script type="text/javascript">

		/**
			This function allows us to dynamically set the currently displayed metric.
			It changes the domain for our color scale and then it iterates over the
			data, updating the fill style for each region.
		*/
		function setMetric(metric){
			color.domain(d3.extent(surveyData,function(d){return +d[metric];}));
			surveyData.forEach(function(d){
				d3.select("#"+d.regionID)
				.transition()
				.duration(1500)
				.style("fill",color(+d[metric]));


			});


		}

		var surveyData = null;

		// we are using a quantize scale to "bin" the data into groups
		var color = d3.scale.quantize()
		.range(colorbrewer.Greens[8]);

		d3.csv("ArchaeoGlobeData.csv", function (data){
			// make the data available
			surveyData = data;

			// color the map according to our default metric
			setMetric("FHG_10KBP");


		// build the popup menu
		var menu = d3.select("#metrics");
		for (prop in surveyData[0]){
			if (prop != "region" && prop != "regionID"){
				menu.append("option").attr("value",prop).text(prop);
			}
		}

		// set the behavior on a change to the menu (i.e., update the coloring)
		d3.select("select").on("change", function () {
			setMetric(this.value);
			});



		});



		</script>

	<select><optgroup label="Metrics" id="metrics"></optgroup></select>
